import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from '../StudentModule/View/'; // Assuming you have a Navbar component
import Home from '../Home'; // Assuming you have a Home component
import ExploreMaterial from '../ExploreMaterial/ExploreMaterial'; // Assuming you have an ExploreMaterial component
import Registration from '../Registration/Registration';
import Login from '../Registration/Login'; // Corrected import path for Login component

function StudentIndex() {
  return (
    <div className="app">
      <Router>
        <Navbar />
        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/explore-material" element={<ExploreMaterial />} />
            <Route path="/view-course" element={<Home />} />
            <Route path="/logout" element={<ExploreMaterial />} />
            <Route path="/register" element={<Registration />} />
            <Route path="/login" element={<Login />} />
            <Route path="/dashboard" element={<ExploreMaterial />} />
          </Routes>
        </main>
        {/* <Footer /> */}
      </Router>
    </div>
  );
}

export default StudentIndex;
